const express = require("express");
const mongoose = require("mongoose");
const cors = require("cors");
const bcrypt = require("bcryptjs");
const jwt = require("jsonwebtoken");
require("dotenv").config();

const app = express();
const PORT = process.env.PORT || 5000;
const SECRET_KEY = "3543564331safsgdtuy"; // Use a secure env value

// Middleware
app.use(cors());
app.use(express.json());

// MongoDB Connection
mongoose.connect("mongodb://127.0.0.1:27017/authDB", {});

const db = mongoose.connection;
db.once("open", () => console.log("âœ… Connected to MongoDB"));
db.on("error", (err) => console.error("âŒ MongoDB connection error:", err));

// User Schema
const userSchema = new mongoose.Schema({
  username: String,
  email: String,
  password: String,
});

const User = mongoose.model("User", userSchema);

// Appointment Schema
const appointmentSchema = new mongoose.Schema({
  userId: mongoose.Schema.Types.ObjectId,
  name: String,
  spouseName: String,
  childName: String,
  mobile: String,
  email: String,
  date: String,
  time: String,
  mainService: String,
  subService: String,
});

const Appointment = mongoose.model("Appointment", appointmentSchema);

// ðŸ” Middleware to verify JWT
const authenticateToken = (req, res, next) => {
  const authHeader = req.headers["authorization"];
  const token = authHeader?.split(" ")[1];

  if (!token) return res.status(401).json({ message: "Access denied. Token missing." });

  try {
    const verified = jwt.verify(token, SECRET_KEY);
    req.user = verified;
    next();
  } catch (err) {
    res.status(403).json({ message: "Invalid or expired token." });
  }
};

// ðŸ“ Signup Route
app.post("/signup", async (req, res) => {
  const { username, email, password } = req.body;

  if (!username || !email || !password) {
    return res.status(400).json({ message: "All fields are required." });
  }

  const existingUser = await User.findOne({ email });
  if (existingUser) {
    return res.status(400).json({ message: "Email already in use." });
  }

  const hashedPassword = await bcrypt.hash(password, 10);

  const newUser = new User({
    username,
    email,
    password: hashedPassword,
  });

  await newUser.save();
  res.status(201).json({ message: "Signup successful!" });
});

// ðŸ”‘ Login Route
app.post("/login", async (req, res) => {
  const { email, password } = req.body;

  const user = await User.findOne({ email });
  if (!user) {
    return res.status(400).json({ message: "User not found." });
  }

  const isMatch = await bcrypt.compare(password, user.password);
  if (!isMatch) {
    return res.status(400).json({ message: "Invalid credentials." });
  }

  const token = jwt.sign({ id: user._id }, SECRET_KEY, { expiresIn: "1h" });

  res.json({
    message: "Login successful!",
    token,
    username: user.username,
  });
});

// ðŸ“… Book Appointment Route (Protected)
app.post("/api/appointments", authenticateToken, async (req, res) => {
  const {
    name,
    spouseName,
    childName,
    mobile,
    email,
    date,
    time,
    mainService,
    subService,
  } = req.body;

  try {
    const newAppointment = new Appointment({
      userId: req.user.id,
      name,
      spouseName,
      childName,
      mobile,
      email,
      date,
      time,
      mainService,
      subService,
    });

    await newAppointment.save();
    res.status(201).json({ message: "Appointment booked successfully!" });
  } catch (error) {
    console.error("Error booking appointment:", error);
    res.status(500).json({ message: "Server error while booking appointment." });
  }
});

// ðŸ“‚ Get All Appointments (Protected)
app.get("/api/appointments", authenticateToken, async (req, res) => {
  try {
    const allAppointments = await Appointment.find({
      userId: req.user.id,
    });

    res.json(allAppointments);
  } catch (error) {
    console.error("Error fetching all appointments:", error);
    res.status(500).json({ message: "Server error while fetching appointments." });
  }
});

// ðŸ“‚ Get Past Appointments (Optional: Keep if needed)
app.get("/api/appointments/past", authenticateToken, async (req, res) => {
  try {
    const today = new Date().toISOString().split("T")[0];

    const pastAppointments = await Appointment.find({
      userId: req.user.id,
      date: { $lt: today },
    });

    res.json(pastAppointments);
  } catch (error) {
    console.error("Error fetching past appointments:", error);
    res.status(500).json({ message: "Server error while fetching past appointments." });
  }
});

